import React from "react";
import "./Home.scss";
import Header from "../../component/header/header";

const Home = () => {
  return (
    <>
      <Header />
      <div className="home">





      
        <div className="container">
          <div className="wrapper">
            <div className="row">
              <div className="col-6 col-12">
                <div className="col-lg-6 w-100">
                    <div className="img">
                    

                    </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
